css:
@-moz-document domain('www.iwatchonline.ph'),
	url-prefix('http://www.iwatchonline.ph'),
	url-prefix('https://www.iwatchonline.ph') {
body {
	background-color: #111;
}
      
.widget {
    background-clip: padding-box;
    background-color: #111;
    border: 1px solid grey;
    border-radius: 6px;
    box-shadow: 0 3px 7px rgba(0, 0, 0, 0.1);
    margin-bottom: 20px;
    outline: medium none;
    top: 10%;
}
		
.page {
    background-clip: padding-box;
    background-color: #111;
    border: 1px solid #111;
    border-radius: 6px;
    box-shadow: 0 3px 7px rgba(0, 0, 0, 0.1);
    margin-bottom: 20px;
    outline: medium none;
    padding: 20px;
    top: 10%;
}

footer {
	background-color: #000 !important;
}
}
